window.bookSummaryJSON = "<p>The aliens are here ... and they want municipal services!</p> <p>Ashley Perrin is fresh out of college and starting a job as a community liaison for the Third District–the city’s only sector with more alien residents than humans. Ashley’s barely found where the paper clips are kept when she’s beset with constituent complaints–from too much noise at the Annual Lupidian Celebration Parade to a trip-and-fall chicken to a very particular type of alien hornet that threatens the very city itself.</p> <p>And if that’s not terrifying enough, Ashley is next up at the office karaoke night.</p> <p>It's <i>Parks and Recreation</i> meets the Federation of Planets in this fast and funny audio exclusive by Hugo Award winner and Audible best seller John Scalzi.</p>"; 
